import Timer from '../components/timer'
import CreateCustomRound from '../components/CreateCustomRound'
import RoundSelector from '../components/RoundSelector'
import Button from '../components/Button'
import rounds from '../src/rounds'

const HomePage = () => {

    return (
        <div className='container'>
        <div className='side-bar'>
            <Button href='/timer' text='USAC Boulder Onsight' query='4BoulderOnsight'/>
            <Button href='/timer' text='USAC Regionals' />
            <Button href='/timer' text='3 Boulder Onsight' />
            <Button href='/timer' text='IFSC Boulder Qualification' />
            <Button href='/timer' text='USAC Modified Redpoint' />
            <Button href='/timer' text='USAC Sport Local Onsight' />
            <Button href='/timer' text='USAC Sport Regionals' />
            <Button href='/timer' text='USAC Sport Divisionals' />
        </div>
            <style global jsx>{`
                body {
                    background-color: black;
                    margin: 0 auto;
                }
            `}</style>
            <style jsx>{`
                .container {
                    display: flex;
                    flex-wrap: wrap;
                }
                .side-bar {
                    width: 20%;
                    height: 100%;
                    background-color: white;
                }
            `}</style>
        </div>
    )
}

export default HomePage
